Based on the 2026 documentation for Expo SDK 54, here's how to store data locally using AsyncStorage:

## Installing AsyncStorage in Expo SDK 54

The recommended way to install AsyncStorage is using the Expo CLI:

```bash
expo install @react-native-async-storage/async-storage
```

This ensures you get the correct version compatible with SDK 54.

## Basic Usage

### Storing Data

```javascript
import AsyncStorage from '@react-native-async-storage/async-storage';

// Store simple string data
const storeData = async (key, value) => {
  try {
    await AsyncStorage.setItem(key, value);
  } catch (e) {
    // Handle error
  }
};
```

### Retrieving Data

```javascript
// Retrieve data
const getData = async (key) => {
  try {
    const value = await AsyncStorage.getItem(key);
    if (value !== null) {
      return value;
    }
  } catch (e) {
    // Handle error
  }
};
```

### Working with JSON Objects

Since AsyncStorage only stores strings, you need to stringify/parse JSON objects:

```javascript
// Store JSON object
const storeObject = async (key, object) => {
  try {
    const jsonValue = JSON.stringify(object);
    await AsyncStorage.setItem(key, jsonValue);
  } catch (e) {
    // Handle error
  }
};

// Retrieve JSON object
const getObject = async (key) => {
  try {
    const jsonValue = await AsyncStorage.getItem(key);
    return jsonValue != null ? JSON.parse(jsonValue) : null;
  } catch (e) {
    // Handle error
  }
};
```

### Removing Data

```javascript
// Remove a single item
const removeItem = async (key) => {
  try {
    await AsyncStorage.removeItem(key);
  } catch (e) {
    // Handle error
  }
};

// Clear all data
const clearAll = async () => {
  try {
    await AsyncStorage.clear();
  } catch (e) {
    // Handle error
  }
};
```

### Merging Data

AsyncStorage supports merging data efficiently:

```javascript
const mergeData = async (key, object) => {
  try {
    await AsyncStorage.mergeItem(key, JSON.stringify(object));
  } catch (e) {
    // Handle error
  }
};
```

## Alternative: expo-sqlite with localStorage API

According to the Expo SDK 54 changelog, there's now an alternative option. **expo-sqlite now includes a drop-in implementation for the localStorage web API**, which can be used for local storage if you want web compatibility:

```javascript
// This provides localStorage API for cross-platform compatibility
import { localStorage } from 'expo-sqlite';

// Use it like web localStorage
localStorage.setItem('key', 'value');
const value = localStorage.getItem('key');
```

## Best Practices

1. **Keep it small** - AsyncStorage is designed for small amounts of data
2. **Security** - AsyncStorage is NOT encrypted by default. Encrypt sensitive data yourself
3. **Error handling** - Always use try/catch blocks to handle errors gracefully
4. **Performance** - For large datasets, consider using expo-sqlite or other database solutions instead

## Important Notes for SDK 54

- AsyncStorage continues to work as before in SDK 54
- It's compatible with both Legacy and New Architecture
- Works on iOS, Android, and web platforms
- Asynchronous operations prevent blocking the main thread

Sources:
- [Expo SDK 54 Changelog](https://expo.dev/changelog/sdk-54)
- [Mastering Async Storage in React Native with Expo - Toxigon](https://toxigon.com/react-native-expo-how-to-use-async-storage)

